PRAGMA foreign_keys = ON;

CREATE TABLE IF NOT EXISTS nodes (
    id TEXT PRIMARY KEY,
    label TEXT,
    description TEXT,
    screenshot_path TEXT,
    annotated_screenshot_path TEXT,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

CREATE TABLE IF NOT EXISTS edges (
    id TEXT PRIMARY KEY,
    source_node_id TEXT,
    target_node_id TEXT,
    label TEXT,
    animated BOOLEAN DEFAULT 1,
    FOREIGN KEY(source_node_id) REFERENCES nodes(id),
    FOREIGN KEY(target_node_id) REFERENCES nodes(id)
);

CREATE TABLE IF NOT EXISTS traffic_index (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    edge_id TEXT,
    burp_ref_id TEXT,
    method TEXT,
    url TEXT,
    status_code INTEGER,
    timestamp_start REAL,
    FOREIGN KEY(edge_id) REFERENCES edges(id)
);

CREATE TABLE IF NOT EXISTS parser_outputs (
    node_id TEXT PRIMARY KEY,
    parsed_content_list TEXT,
    label_coordinates TEXT,
    FOREIGN KEY(node_id) REFERENCES nodes(id)
);

DELETE FROM traffic_index;
DELETE FROM parser_outputs;
DELETE FROM edges;
DELETE FROM nodes;

